// aSync Await

const getImagen = async () => {
    const apiKey = '2dwhHKI56ba5Zqfa6JiQMx7wyKxuF4gU';
    const res = await fetch(`https://api.giphy.com/v1/gifs/random?api_key=${apiKey}`);
    const data = await res.json();

    console.log(data);

    return "https://www.google.com.ar";
}

getImagen();
